import React from 'react';
// import './MyInput.js';
import './MyInput.css'

class MyInput extends React.Component {

    render(props) {
        return (
            <div className="Div-my-input">
                <span className="Label">{props.label}</span>
                <input className="My-input" value={props.value}/>
            </div>
        );
    }
}
